import './App.css';
import { Route, HashRouter, Switch} from "react-router-dom"; 
import { Header, Footer } from './component';
import { Home, Final_Project } from './pages';
import routes from './config/routes';

const App = () => {
  return (
    <HashRouter>
      <div className="App">
        <div>
          <Header />
        </div>
        <div className="content">
          <Switch>
            {routes.map((route) => {
              return (
                <Route
                  path={route.path}
                  component={route.component}
                  key={route.path}
                />
              );
            })}
          </Switch>
        </div>
        <div>
          <Footer />
        </div>
      </div>
    </HashRouter>
  );
}

export default App;
